           end do 
         end if
         ! write(*,'(" interface: FINISH ME")') 
         ! stop 1111
       else
         numberOfPolarizationVectors2=0
       end if
             do kd=0,nd-1
              dx112(kd) = 1./(2.*dx1(kd))
              dx122(kd) = 1./(dx1(kd)**2)
              dx212(kd) = 1./(2.*dx2(kd))
              dx222(kd) = 1./(dx2(kd)**2)
