                          u1(i1-is1,i2-is2,i3-is3,ey)=(5.*u1(i1,i2,i3,ey)-10.*u1(i1+is1,i2+is2,i3+is3,ey)+10.*u1(i1+2*is1,i2+2*is2,i3+2*is3,ey)-5.*u1(i1+3*is1,i2+3*is2,i3+3*is3,ey)+u1(i1+4*is1,i2+4*is2,i3+4*is3,ey))
                          u1(i1-is1,i2-is2,i3-is3,ez)=(5.*u1(i1,i2,i3,ez)-10.*u1(i1+is1,i2+is2,i3+is3,ez)+10.*u1(i1+2*is1,i2+2*is2,i3+2*is3,ez)-5.*u1(i1+3*is1,i2+3*is2,i3+3*is3,ez)+u1(i1+4*is1,i2+4*is2,i3+4*is3,ez))
                          u2(j1-js1,j2-js2,j3-js3,ex)=(5.*u2(j1,j2,j3,ex)-10.*u2(j1+js1,j2+js2,j3+js3,ex)+10.*u2(j1+2*js1,j2+2*js2,j3+2*js3,ex)-5.*u2(j1+3*js1,j2+3*js2,j3+3*js3,ex)+u2(j1+4*js1,j2+4*js2,j3+4*js3,ex))
                          u2(j1-js1,j2-js2,j3-js3,ey)=(5.*u2(j1,j2,j3,ey)-10.*u2(j1+js1,j2+js2,j3+js3,ey)+10.*u2(j1+2*js1,j2+2*js2,j3+2*js3,ey)-5.*u2(j1+3*js1,j2+3*js2,j3+3*js3,ey)+u2(j1+4*js1,j2+4*js2,j3+4*js3,ey))
                          u2(j1-js1,j2-js2,j3-js3,ez)=(5.*u2(j1,j2,j3,ez)-10.*u2(j1+js1,j2+js2,j3+js3,ez)+10.*u2(j1+2*js1,j2+2*js2,j3+2*js3,ez)-5.*u2(j1+3*js1,j2+3*js2,j3+3*js3,ez)+u2(j1+4*js1,j2+4*js2,j3+4*js3,ez))
                          u1(i1-2*is1,i2-2*is2,i3-2*is3,ex)=(5.*u1(i1-is1,i2-is2,i3-is3,ex)-10.*u1(i1-is1+is1,i2-is2+is2,i3-is3+is3,ex)+10.*u1(i1-is1+2*is1,i2-is2+2*is2,i3-is3+2*is3,ex)-5.*u1(i1-is1+3*is1,i2-is2+3*is2,i3-is3+3*is3,ex)+u1(i1-is1+4*is1,i2-is2+4*is2,i3-is3+4*is3,ex))
                          u1(i1-2*is1,i2-2*is2,i3-2*is3,ey)=(5.*u1(i1-is1,i2-is2,i3-is3,ey)-10.*u1(i1-is1+is1,i2-is2+is2,i3-is3+is3,ey)+10.*u1(i1-is1+2*is1,i2-is2+2*is2,i3-is3+2*is3,ey)-5.*u1(i1-is1+3*is1,i2-is2+3*is2,i3-is3+3*is3,ey)+u1(i1-is1+4*is1,i2-is2+4*is2,i3-is3+4*is3,ey))
                          u1(i1-2*is1,i2-2*is2,i3-2*is3,ez)=(5.*u1(i1-is1,i2-is2,i3-is3,ez)-10.*u1(i1-is1+is1,i2-is2+is2,i3-is3+is3,ez)+10.*u1(i1-is1+2*is1,i2-is2+2*is2,i3-is3+2*is3,ez)-5.*u1(i1-is1+3*is1,i2-is2+3*is2,i3-is3+3*is3,ez)+u1(i1-is1+4*is1,i2-is2+4*is2,i3-is3+4*is3,ez))
                          u2(j1-2*js1,j2-2*js2,j3-2*js3,ex)=(5.*u2(j1-js1,j2-js2,j3-js3,ex)-10.*u2(j1-js1+js1,j2-js2+js2,j3-js3+js3,ex)+10.*u2(j1-js1+2*js1,j2-js2+2*js2,j3-js3+2*js3,ex)-5.*u2(j1-js1+3*js1,j2-js2+3*js2,j3-js3+3*js3,ex)+u2(j1-js1+4*js1,j2-js2+4*js2,j3-js3+4*js3,ex))
                          u2(j1-2*js1,j2-2*js2,j3-2*js3,ey)=(5.*u2(j1-js1,j2-js2,j3-js3,ey)-10.*u2(j1-js1+js1,j2-js2+js2,j3-js3+js3,ey)+10.*u2(j1-js1+2*js1,j2-js2+2*js2,j3-js3+2*js3,ey)-5.*u2(j1-js1+3*js1,j2-js2+3*js2,j3-js3+3*js3,ey)+u2(j1-js1+4*js1,j2-js2+4*js2,j3-js3+4*js3,ey))
