                               a12(11,10)=-( an3*an2*eqn2Coeff2a + (  -an3*an2)*eqn2Coeff2b )
                               a12(11,11)=-( an3*an3*eqn2Coeff2a + (1.-an3*an3)*eqn2Coeff2b )
                              ! Equation 6..11 :  extrapolate 2nd ghost point 
                              cex1=1.
                              cex2=-5. ! ** fix me ** orderOfExtrapolation for 2nd ghost point 
                              ! *e678*
                              ! do ii=6,11
                              !   do jj=0,11
                              !     a12(ii,jj)=0.
                              !   end do
