                              ! a12(8,2)  = cex2   ! w1(-1)
                              ! a12(8,5)  = cex1   ! w1(-2)
                              ! a12(9,6)  = cex2   ! u2(-1)
                              ! a12(9,9)  = cex1   ! u2(-2)
                              ! a12(10,7) = cex2   ! v2(-1)
