                                           call ogderiv(ep, 2,0,0,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,ex+n, estt(n) )
                                           call ogderiv(ep, 0,1,0,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,ex+n, esx(n) )
                                           call ogderiv(ep, 0,0,1,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,ex+n, esy(n) )
                                           call ogderiv(ep, 0,0,0,1, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,ex+n, esz(n) )
                                           call ogderiv(ep, 0,2,0,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,ex+n, esxx(n) )
                                           call ogderiv(ep, 0,0,2,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,ex+n, esyy(n) )
