                                               call ogderiv(ep, 0,0,2,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, peyy(n) )
                                               call ogderiv(ep, 0,0,0,2, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, pezz(n) )
                                               call ogderiv(ep, 1,1,0,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, petx(n) )
                                               call ogderiv(ep, 1,0,1,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, pety(n) )
                                               call ogderiv(ep, 1,0,0,1, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, petz(n) )
                                               call ogderiv(ep, 1,2,0,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, petxx(n) )
                                               call ogderiv(ep, 1,0,2,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, petyy(n) )
                                               call ogderiv(ep, 1,0,0,2, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, petzz(n) )
                                               call ogderiv(ep, 2,1,0,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, pettx(n) )
                                               call ogderiv(ep, 2,0,1,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, petty(n) )
                                               call ogderiv(ep, 2,0,0,1, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, pettz(n) )
                                               call ogderiv(ep, 2,2,0,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, pettxx(n) )
                                               call ogderiv(ep, 2,0,2,0, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, pettyy(n) )
                                               call ogderiv(ep, 2,0,0,2, xy2(j1,j2,j3,0),xy2(j1,j2,j3,1),xy2(j1,j2,j3,2),t,pc+n, pettzz(n) )
                                               peL  = c2**2*( pexx(n)   + peyy(n)   + pezz(n)  )
                                               petL = c2**2*( petxx(n)  + petyy(n)  + petzz(n) )
                                               pettL= c2**2*( pettxx(n) + pettyy(n) + pettzz(n) )
                                               ! Normal TZ forcing for P_{n,jv} equation: 
                                               fpv2(n,jv) = pett(n)   + b1v2(jv)*pet(n)   + b0v2(jv)*pe(n)   - a0v2(jv)*es(n)   - a1v2(jv)*est(n)
                                               fPt2(n,jv) = pettt(n)  + b1v2(jv)*pett(n)  + b0v2(jv)*pet(n)  - a0v2(jv)*est(n)  - a1v2(jv)*estt(n)
                                               fPtt2(n,jv)= petttt(n) + b1v2(jv)*pettt(n) + b0v2(jv)*pett(n) - a0v2(jv)*estt(n) - a1v2(jv)*esttt(n)
                                               LfP2(n,jv) = pettL     + b1v2(jv)*petL     + b0v2(jv)*peL     - a0v2(jv)*esL     - a1v2(jv)*estL
                                               fpvx2(n,jv)= pettx(n)  + b1v2(jv)*petx(n)  + b0v2(jv)*pex(n)  - a0v2(jv)*esx(n)  - a1v2(jv)*estx(n)
                                               fpvy2(n,jv)= petty(n)  + b1v2(jv)*pety(n)  + b0v2(jv)*pey(n)  - a0v2(jv)*esy(n)  - a1v2(jv)*esty(n)
                                               fpvz2(n,jv)= pettz(n)  + b1v2(jv)*petz(n)  + b0v2(jv)*pez(n)  - a0v2(jv)*esz(n)  - a1v2(jv)*estz(n)
