                                      f(8) = f(8) - ( (curlLapEez- nDotCurlLapEe*an3)*(1./(mu1*epsmu1)-1./(mu2*epsmu2)) ) + (alphaP1/mu1)*( curlPevttzSum1 - an3*nDotCurlPevttSum1 ) - (alphaP2/mu2)*( curlPevttzSum2 - an3*nDotCurlPevttSum2 ) 
                                      nDotPevttLSum1 = an1*pevttLSum1(0)  + an2*pevttLSum1(1)  + an3*pevttLSum1(2)
                                      nDotPevttttSum1= an1*pevttttSum1(0) + an2*pevttttSum1(1) + an3*pevttttSum1(2)
                                      nDotPevttLSum2 = an1*pevttLSum2(0)  + an2*pevttLSum2(1)  + an3*pevttLSum2(2)
                                      nDotPevttttSum2= an1*pevttttSum2(0) + an2*pevttttSum2(1) + an3*pevttttSum2(2)
                                      f(9) = f(9) - ( ueLapSq*(1./epsmu1**2-1./epsmu2**2) + nDotLapSqEe*an1*(cem1/epsmu1-cem2/epsmu2) ) + alphaP1*(  (pevttLSum1(0)-an1*nDotPevttLSum1)/epsmu1 + (pevttttSum1(0)-an1*nDotPevttttSum1) ) - alphaP2*(  (pevttLSum2(0)-an1*nDotPevttLSum2)/epsmu2 + (pevttttSum2(0)-an1*nDotPevttttSum2) )
                                      f(10)= f(10)- ( veLapSq*(1./epsmu1**2-1./epsmu2**2) + nDotLapSqEe*an2*(cem1/epsmu1-cem2/epsmu2) ) + alphaP1*(  (pevttLSum1(1)-an2*nDotPevttLSum1)/epsmu1 + (pevttttSum1(1)-an2*nDotPevttttSum1) ) - alphaP2*(  (pevttLSum2(1)-an2*nDotPevttLSum2)/epsmu2 + (pevttttSum2(1)-an2*nDotPevttttSum2) )
                                      f(11)= f(11)- ( weLapSq*(1./epsmu1**2-1./epsmu2**2) + nDotLapSqEe*an3*(cem1/epsmu1-cem2/epsmu2) )  + alphaP1*(  (pevttLSum1(2)-an3*nDotPevttLSum1)/epsmu1 + (pevttttSum1(2)-an3*nDotPevttttSum1) ) - alphaP2*(  (pevttLSum2(2)-an3*nDotPevttLSum2)/epsmu2 + (pevttttSum2(2)-an3*nDotPevttttSum2) )
                                    end if
                                   ! eval3dJumpOrder4New()
                              end if
                              ! fill in the current values for the unknowns: 
                              q(0) = u1(i1-is1,i2-is2,i3-is3,ex)
                              q(1) = u1(i1-is1,i2-is2,i3-is3,ey)
                              q(2) = u1(i1-is1,i2-is2,i3-is3,ez)
                              q(3) = u1(i1-2*is1,i2-2*is2,i3-2*is3,ex)
                              q(4) = u1(i1-2*is1,i2-2*is2,i3-2*is3,ey)
                              q(5) = u1(i1-2*is1,i2-2*is2,i3-2*is3,ez)
                              q(6) = u2(j1-js1,j2-js2,j3-js3,ex)
                              q(7) = u2(j1-js1,j2-js2,j3-js3,ey)
                              q(8) = u2(j1-js1,j2-js2,j3-js3,ez)
                              q(9) = u2(j1-2*js1,j2-2*js2,j3-2*js3,ex)
                              q(10)= u2(j1-2*js1,j2-2*js2,j3-2*js3,ey)
                              q(11)= u2(j1-2*js1,j2-2*js2,j3-2*js3,ez)
                              ! subtract off the contributions from the wrong values at the ghost points:
                              numberOfEquations=12
                              do n=0,numberOfEquations-1
                                f(n) = (a12(n,0)*q(0)+a12(n,1)*q(1)+a12(n,2)*q(2)+a12(n,3)*q(3)+a12(n,4)*q(4)+a12(n,5)*q(5)+a12(n,6)*q(6)+a12(n,7)*q(7)+a12(n,8)*q(8)+a12(n,9)*q(9)+a12(n,10)*q(10)+a12(n,11)*q(11) ) - f(n)
                              end do
                              if( debug.gt.3 )then
                                write(debugFile,'(" --> 3d:order4-c: f(subtract)=",12e10.2)') (f(n),n=0,11)
                              end if
                              if( .false. )then
                                do n=0,numberOfEquations-1
                                  write(debugFile,'("a(i,j)=",12(1pe10.2))') (a12(n,m),m=0,11)
                                end do
                              end if
                              ! solve A Q = F
                              ! factor the matrix
                              call dgeco( a12(0,0), numberOfEquations, numberOfEquations, ipvt(0),rcond,work(0))
                              if( debug.gt.3 )then
                                write(debugFile,'(" --> 3d:order4-c: rcond=",e10.2)') rcond
                                write(debugFile,'(" eqn1Coeff1a,eqn1Coeff1b,eqn1Coeff2a,eqn1Coeff2b=",4(1pe10.2))') eqn1Coeff1a,eqn1Coeff1b,eqn1Coeff2a,eqn1Coeff2b
                                write(debugFile,'(" eqn2Coeff1a,eqn2Coeff1b,eqn2Coeff2a,eqn2Coeff2b=",4(1pe10.2))') eqn2Coeff1a,eqn2Coeff1b,eqn2Coeff2a,eqn2Coeff2b
                              end if
                              ! solve
                              job=0
                              call dgesl( a12(0,0), numberOfEquations, numberOfEquations, ipvt(0), f(0), job)
                              if( debug.gt.3 )then
                                write(debugFile,'(" --> 3d:order4-c: f(solve)=",12e10.2)') (f(n),n=0,11)
                                write(debugFile,'(" --> 3d:order4-c:        q=",12e10.2)') (q(n),n=0,11)
                                write(debugFile,'(" --> 3d:order4-c:      f-q=",12e10.2)') (f(n)-q(n),n=0,11)
                              end if
                              ! fill in the answer:
                              if( useJacobiUpdate.eq.0 )then
                                u1(i1-is1,i2-is2,i3-is3,ex)      =f(0 )*omega+(1.-omega)*q(0)
                                u1(i1-is1,i2-is2,i3-is3,ey)      =f(1 )*omega+(1.-omega)*q(1)
                                u1(i1-is1,i2-is2,i3-is3,ez)      =f(2 )*omega+(1.-omega)*q(2)
                                u1(i1-2*is1,i2-2*is2,i3-2*is3,ex)=f(3 )*omega+(1.-omega)*q(3)
                                u1(i1-2*is1,i2-2*is2,i3-2*is3,ey)=f(4 )*omega+(1.-omega)*q(4)
                                u1(i1-2*is1,i2-2*is2,i3-2*is3,ez)=f(5 )*omega+(1.-omega)*q(5)
                                u2(j1-js1,j2-js2,j3-js3,ex)      =f(6 )*omega+(1.-omega)*q(6)
                                u2(j1-js1,j2-js2,j3-js3,ey)      =f(7 )*omega+(1.-omega)*q(7)
                                u2(j1-js1,j2-js2,j3-js3,ez)      =f(8 )*omega+(1.-omega)*q(8)
                                u2(j1-2*js1,j2-2*js2,j3-2*js3,ex)=f(9 )*omega+(1.-omega)*q(9)
                                u2(j1-2*js1,j2-2*js2,j3-2*js3,ey)=f(10)*omega+(1.-omega)*q(10)
                                u2(j1-2*js1,j2-2*js2,j3-2*js3,ez)=f(11)*omega+(1.-omega)*q(11)
                              else
                                ! Jacobi-update -- save results in the work space
                                wk1(i1-is1,i2-is2,i3-is3,ex)      =f(0 )*omega+(1.-omega)*q(0)
                                wk1(i1-is1,i2-is2,i3-is3,ey)      =f(1 )*omega+(1.-omega)*q(1)
                                wk1(i1-is1,i2-is2,i3-is3,ez)      =f(2 )*omega+(1.-omega)*q(2)
                                wk1(i1-2*is1,i2-2*is2,i3-2*is3,ex)=f(3 )*omega+(1.-omega)*q(3)
                                wk1(i1-2*is1,i2-2*is2,i3-2*is3,ey)=f(4 )*omega+(1.-omega)*q(4)
                                wk1(i1-2*is1,i2-2*is2,i3-2*is3,ez)=f(5 )*omega+(1.-omega)*q(5)
                                wk2(j1-js1,j2-js2,j3-js3,ex)      =f(6 )*omega+(1.-omega)*q(6)
                                wk2(j1-js1,j2-js2,j3-js3,ey)      =f(7 )*omega+(1.-omega)*q(7)
                                wk2(j1-js1,j2-js2,j3-js3,ez)      =f(8 )*omega+(1.-omega)*q(8)
                                wk2(j1-2*js1,j2-2*js2,j3-2*js3,ex)=f(9 )*omega+(1.-omega)*q(9)
                                wk2(j1-2*js1,j2-2*js2,j3-2*js3,ey)=f(10)*omega+(1.-omega)*q(10)
                                wk2(j1-2*js1,j2-2*js2,j3-2*js3,ez)=f(11)*omega+(1.-omega)*q(11)
                              end if
                              ! compute the maximum change in the solution for this iteration
                              do n=0,11
                                err=max(err,abs(q(n)-f(n)))
                                err2 = err2 + (q(n)-f(n))**2
                                count = count + 1
                              end do
                              if( .true. .or. debug.gt.3 )then ! re-evaluate
                               do n=0,11
                                 errv(n)=abs(q(n)-f(n))
                               end do
                               ! evalDerivs3dOrder4()
                               ! eval3dJumpOrder4New()
                                ! Evaluate TZ forcing for dispersive equations in 2=3D 
                                  if( twilightZone.eq.1 )then
                                    if( dispersionModel1.ne.noDispersion )then
                                      do n=0,nd-1
                                        fpSum1(n)=0.
                                        pevttSum1(n)=0.
                                        pevttxSum1(n)=0.
                                        pevttySum1(n)=0.
                                        pevttzSum1(n)=0.
                                        pevttLSum1(n)=0.
                                        pevttttSum1(n)=0.
                                        petttSum=0.
                                        call ogderiv(ep, 0,0,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, es(n)   ) 
                                        call ogderiv(ep, 1,0,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, est(n)  )
                                        call ogderiv(ep, 2,0,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, estt(n) )
                                        call ogderiv(ep, 0,1,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esx(n) )
                                        call ogderiv(ep, 0,0,1,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esy(n) )
                                        call ogderiv(ep, 0,0,0,1, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esz(n) )
                                        call ogderiv(ep, 0,2,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esxx(n) )
                                        call ogderiv(ep, 0,0,2,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esyy(n) )
                                        call ogderiv(ep, 0,0,0,2, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, eszz(n) )
                                        call ogderiv(ep, 1,1,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, estx(n) )
                                        call ogderiv(ep, 1,0,1,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esty(n) )
                                        call ogderiv(ep, 1,0,0,1, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, estz(n) )
                                        call ogderiv(ep, 2,1,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esttx(n) )
                                        call ogderiv(ep, 2,0,1,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, estty(n) )
                                        call ogderiv(ep, 2,0,0,1, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esttz(n) )
                                        call ogderiv(ep, 0,3,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esxxx(n) )
                                        call ogderiv(ep, 0,2,1,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esxxy(n) )
                                        call ogderiv(ep, 0,1,2,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esxyy(n) )
                                        call ogderiv(ep, 0,0,3,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esyyy(n) )
                                        call ogderiv(ep, 0,2,0,1, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esxxz(n) )
                                        call ogderiv(ep, 0,1,0,2, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esxzz(n) )
                                        call ogderiv(ep, 0,0,2,1, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esyyz(n) )
                                        call ogderiv(ep, 0,0,1,2, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esyzz(n) )
                                        call ogderiv(ep, 0,0,0,3, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, eszzz(n) )
                                        call ogderiv(ep, 3,0,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esttt(n) )
                                        call ogderiv(ep, 4,0,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, estttt(n) )
                                        call ogderiv(ep, 1,2,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, estxx(n) )
                                        call ogderiv(ep, 1,0,2,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, estyy(n) )
                                        call ogderiv(ep, 1,0,0,2, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, estzz(n) )
                                        call ogderiv(ep, 2,2,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esttxx(n) )
                                        call ogderiv(ep, 2,0,2,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esttyy(n) )
                                        call ogderiv(ep, 2,0,0,2, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esttzz(n) )
                                        call ogderiv(ep, 0,4,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esxxxx(n) )
                                        call ogderiv(ep, 0,2,2,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esxxyy(n) )
                                        call ogderiv(ep, 0,0,4,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esyyyy(n) )
                                        call ogderiv(ep, 0,0,0,4, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, eszzzz(n) )
                                        call ogderiv(ep, 0,2,0,2, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esxxzz(n) )
                                        call ogderiv(ep, 0,0,2,2, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,ex+n, esyyzz(n) )
                                        ! L = c1^2*Delta
                                        esL  = c1**2*( esxx(n)   + esyy(n)   + eszz(n)  )
                                        estL = c1**2*( estxx(n)  + estyy(n)  + estzz(n) )
                                        esttL= c1**2*( esttxx(n) + esttyy(n) + esttzz(n) )
                                        esLx  = c1**2*( esxxx(n) + esxyy(n) + esxzz(n))
                                        esLy  = c1**2*( esxxy(n) + esyyy(n) + esyzz(n) )
                                        esLz  = c1**2*( esxxz(n) + esyyz(n) + eszzz(n) )
                                        ! L^2 : (xx + yy + zz)*( xx + yy + zz )
                                        esLL = c1**4*( esxxxx(n) + esyyyy(n) + eszzzz(n) + 2.*( esxxyy(n) + esxxzz(n) + esyyzz(n)) )
                                        do jv=0,numberOfPolarizationVectors1-1
                                          ! The TZ component is offset by pxc
                                          pc = pxc + jv*nd
                                          call ogderiv(ep, 0,0,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, pe(n)   )
                                          call ogderiv(ep, 1,0,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, pet(n)  )
                                          call ogderiv(ep, 2,0,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, pett(n) )
                                          call ogderiv(ep, 3,0,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, pettt(n) )
                                          call ogderiv(ep, 4,0,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, petttt(n) )
                                          call ogderiv(ep, 0,1,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, pex(n) )
                                          call ogderiv(ep, 0,0,1,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, pey(n) )
                                          call ogderiv(ep, 0,0,0,1, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, pez(n) )
                                          call ogderiv(ep, 0,2,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, pexx(n) )
                                          call ogderiv(ep, 0,0,2,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, peyy(n) )
                                          call ogderiv(ep, 0,0,0,2, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, pezz(n) )
                                          call ogderiv(ep, 1,1,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, petx(n) )
                                          call ogderiv(ep, 1,0,1,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, pety(n) )
                                          call ogderiv(ep, 1,0,0,1, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, petz(n) )
                                          call ogderiv(ep, 1,2,0,0, xy1(i1,i2,i3,0),xy1(i1,i2,i3,1),xy1(i1,i2,i3,2),t,pc+n, petxx(n) )
