      c2PttttP=((b0*alpha**3*a1**3+(3.*b1*a1**2-2.*a1*a0)*b0*alpha**2+(-2.*a1*b0**2+(3.*a1*b1**2-2.*a0*b1)*b0)*alpha+b0*b1**3-2.*b0**2*b1)*dt**2+(((-1.*d1+1.)*a1**2*b0-1.*a0*a1*b1)*alpha**2+(((-2.*d1+1.)*a1*b1+a0*d1)*b0-1.*a0*b1**2)*alpha-1.*b0*b1**2*d1+b0**2*d1)*dt-2.*b1*alpha**2*a1**2+(-4.*a1*b1**2+2.*a0*b1+2.*a1*b0)*alpha-2.*b1**3+4.*b0*b1)/dt/d1
