      c2PttttfP=(-1.*a1**3*alpha**3*dt+((-3.*b1*a1**2+2.*a1*a0)*dt+a1**2*d1)*alpha**2+(((-3.*b1**2+2.*b0)*a1+2.*a0*b1)*dt+2.*a1*b1*d1-1.*a0*d1)*alpha+(-1.*b1**3+2.*b0*b1)*dt+b1**2*d1-1.*b0*d1)/d1
