                                        aj1sxt = (rsxy1(i1,i2,i3-2,1,0)-8.*rsxy1(i1,i2,i3-1,1,0)+8.*rsxy1(i1,i2,i3+1,1,0)-rsxy1(i1,i2,i3+2,1,0))/(12.*dr1(2))
